import "./SubmitStyle.css"
import React, { useState } from "react";
import Process from "../Process/Process";
export default function Submit(){
    const [selectedFile1, setSelectedFile1] = useState(null);
    function handleFileInputChange1(event) {
      setSelectedFile1(event.target.files[0]);
    }

    const [selectedFile2, setSelectedFile2] = useState(null);
    function handleFileInputChange2(event) {
      setSelectedFile2(event.target.files[0]);
    }
    
    const [selectedFile3, setSelectedFile3] = useState(null);
    function handleFileInputChange3(event) {
      setSelectedFile3(event.target.files[0]);
    }
    const [showPopup, setShowPopup] = useState(false);
    function handleShowPopup(item) {
      setShowPopup(item);
    }
    return (
        <>
            <div id="submit">
                <div className="button1">
                    {/* <span>Submit your Model</span> */}
                    <label htmlFor="file-upload1" className="span1">Submit your Model</label>
                    <input id="file-upload1" type="file" onChange={handleFileInputChange1} style={{display:"none"}}/>
                </div>
                <div className="button2">
                    {/* <span>Model and picture</span> */}
                    <label htmlFor="file-upload2" className="span2">Model & </label>
                    <label htmlFor="file-upload3" className="span3">Picture</label>
                    <input id="file-upload2" type="file" onChange={handleFileInputChange2} style={{display:"none"}} />
                    {/* <span> & </span> */}
                    <input id="file-upload3" type="file" onChange={handleFileInputChange3} style={{display:"none"}}/>
                </div>
                <div className="button3">
                  <span onClick={()=> setShowPopup(true)}>Run</span>
                </div>
                <div className="popup">
                    {showPopup && (<Process showPopup={showPopup}/>)}
                </div>
            </div>
        </>
    );
}
